window.bookSummaryJSON = "<p><b>Forbidden fruit has never tasted so sweet.</b></p> <p>Paris is full of vibrance and flavor. It's a place where dreams are forged and broken. The city of love has everything to offer, and I want it all.</p> <p>There's a new restaurant in town offering a unique chance at becoming sous chef if you can prove you're the best of ten competitors. And I won't let anything stand in the way of my culinary victory.</p> <p>But the pretty little French girl with golden hair and cherry red lips sharing my station in the Dix kitchen throws my entire world off its axis.</p> <p>Aur√©lie is the surprise I never saw coming and the distraction I never wanted. And more than anything else, I want to make her mine.</p> <p>She feeds a darker side of me that I don't think I can ever deny again. And I'm dying for another taste.</p> <p>Shades of Red <i>is an interconnected duet featuring Gavin Greyson. It's an enemies-to-lovers, forced proximity, workplace romance, with a dark secret. This is a dark and spicy romance that contains morally grey characters and mature themes. A complete list of content warnings can be found on the author's website.</i></p>"; 
